// Logical instructions:

void _LOGICAL( int op, int arg, int qual, int size, uint5_t rA, uint5_t rS, uint5_t rB, uint16_t UIMM, uint1_t OE, uint1_t Rc ) {
  sint32_t rA_sval;
  sint32_t rS_uval = GPRS[rS], rB_uval = GPRS[rB];
  /* Using a signed type (sint32_t) for usigned variables (rX_uval)
   * because the value 0xffffffff can't be represented in UPPAAL as
   * an unsigned value (max. unsigned value in UPPAAL is 0x7fffffff).
   * It us not a problem since we don't make any algebraic operation
   * but only bitwise operations.
   */

  uint5_t n        = 31;
  uint5_t sign_bit = (size == SIZE_BYTE ? 7 : 15);
  uint1_t S        = getBit (rS_uval, sign_bit);
  if ( op == OP_AND  ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval &    ( rB_uval <<  0 ) ); }
                                                  if ( qual == QUAL_COMPLEMENT ) { GPRS[rA] =    ( rS_uval & NOT( rB_uval <<  0 ) ); } }
                         if ( arg == ARG_UIMM ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval &    ( UIMM    <<  0 ) ); }
                                                  if ( qual == QUAL_SHIFT      ) { GPRS[rA] =    ( rS_uval &    ( UIMM    << 16 ) ); } } }
  if ( op == OP_CLZ  ) { if ( arg == ARG_NONE ) { if ( qual == QUAL_NONE       ) { GPRS[rA] = CLZ( rS_uval                        ); } } }
  if ( op == OP_EQV  ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] = NOT( rS_uval ^    ( rB_uval <<  0 ) ); } } }
  if ( op == OP_EXT  ) { if ( arg == ARG_NONE ) { if ( size == SIZE_BYTE       ) { GPRS[rA] =    ( rS_uval &    (   255   <<  0 ) ); }
                                                  if ( size == SIZE_HALFWORD   ) { GPRS[rA] =    ( rS_uval &    ( 65535   <<  0 ) ); }
                                                  setBits (GPRS[rA], 31, sign_bit, S)                                                ;   } }

  if ( op == OP_NAND ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] = NOT( rS_uval &    ( rB_uval <<  0 ) ); } } }
  if ( op == OP_NEG  ) { if ( arg == ARG_NONE ) { if ( qual == QUAL_NONE       ) { GPRS[rA] = NOT( rS_uval                        ); } } }
  if ( op == OP_NOR  ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] = NOT( rS_uval |    ( rB_uval <<  0 ) ); } } }
  if ( op == OP_OR   ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval |    ( rB_uval <<  0 ) ); }
                                                  if ( qual == QUAL_COMPLEMENT ) { GPRS[rA] =    ( rS_uval | NOT( rB_uval <<  0 ) ); } }
                         if ( arg == ARG_UIMM ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval |    ( UIMM    <<  0 ) ); } }
                                                  if ( qual == QUAL_SHIFT      ) { GPRS[rA] =    ( rS_uval |    ( rB_uval << 16 ) ); }   }
  if ( op == OP_XOR  ) { if ( arg == ARG_REG  ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval ^    ( rB_uval <<  0 ) ); } }
                         if ( arg == ARG_UIMM ) { if ( qual == QUAL_NONE       ) { GPRS[rA] =    ( rS_uval ^    ( rB_uval <<  0 ) ); }
                                                  if ( qual == QUAL_SHIFT      ) { GPRS[rA] =    ( rS_uval ^    ( rB_uval << 16 ) ); } } }

  rA_sval = GPRS[rA]; // TODO: consider as unsigned?
  if ( OE ) { setXERi (     XER_OV, false                        );   /* Always false as UPPAAL disallow overflowing. */
              setXERi (     XER_SO, getBit (XER, XER_OV)         ); }
  if ( Rc ) { setCRni (cr0,  CR_SO, getBit (XER, XER_SO)         );
              setCRni (cr0,  CR_EQ, (rA_sval == 0 ? true : false));
              setCRni (cr0,  CR_GT, (rA_sval >  0 ? true : false));
              setCRni (cr0,  CR_LT, (rA_sval <  0 ? true : false)); }
}

